function setup() {
  imageMode(CENTER);
  angleMode(DEGREES);
  background(255,0);
  var myCanvas=createCanvas(windowWidth, windowHeight);
  myCanvas.parent('main');
}

function draw(){
    frameRate(10);
}

function mouseMoved() {
  let randomFlower=random(flowers);
  let dimension=windowHeight/3;
  let randomD=random(windowHeight/4,windowHeight/2);
  let randomR=random(360);
  counter++;

  if(counter==3){
    push();
    translate(mouseX,mouseY);
    rotate(randomR);  
    // image(randomFlower,0, 0, randomD, randomD);
    image(randomFlower,0, 0, dimension, dimension);
    pop();
  } else if (counter>7){
    counter=0;
  }; 
}

function windowResized() {
    resizeCanvas(windowWidth, windowHeight);
  }

